unsigned int long long __readmsr(unsigned long __register) {
	// Loads the contents of a 64-bit model specific register (MSR) specified in
	// the ECX register into registers EDX:EAX. The EDX register is loaded with
	// the high-order 32 bits of the MSR and the EAX register is loaded with the
	// low-order 32 bits. If less than 64 bits are implemented in the MSR being
	// read, the values returned to EDX:EAX in unimplemented bit locations are
	// undefined.
	unsigned long __edx;
	unsigned long __eax;
	__asm__("rdmsr" : "=d"(__edx), "=a"(__eax) : "c"(__register));
	return (((unsigned int long long)__edx) << 32) | (unsigned int long long)__eax;
}

int kpayload(struct thread *td, struct kpayload_args* args) {

	//Starting kpayload...

	struct ucred* cred;
	struct filedesc* fd;

	fd = td->td_proc->p_fd;
	cred = td->td_proc->p_ucred;

	//Reading kernel_base...
	void*  got_prison0  = (void*) 0xFFFFFFFF82C58BF0ULL;
	void** got_rootvnode= (void**)0xFFFFFFFF82FF8710ULL;
	void*  kernel_base  = (void*) 0xFFFFFFFF82200000ULL;
	size_t(*printfkernel)(const char* fmt, ...) = (void*)0xFFFFFFFF824CE1A0ULL;
	int(*copyout)(const void *kaddr, void *uaddr, size_t len) = (void *)(0xFFFFFFFF8266F6B0ULL);
	int(*copyin)(const void *uaddr, void *kaddr, size_t len) = (void *)(0xFFFFFFFF8266F730ULL);

	//Resolve kernel functions...
	
	printfkernel("resolve kernel funcs\n");
	cred->cr_uid = 0;
	cred->cr_ruid = 0;
	cred->cr_rgid = 0;
	cred->cr_groups[0] = 0;

	cred->cr_prison = got_prison0;
	fd->fd_rdir = fd->fd_jdir = *got_rootvnode;

	//Kexec init
	printfkernel("kexec init\n");
	void *DT_HASH_SEGMENT = (void *)(0xffffffff82200160);
	memcpy(DT_HASH_SEGMENT, kexec, kexec_size);

	void(*kexec_init)(void *, void *) = DT_HASH_SEGMENT;

	kexec_init((void *)(0xFFFFFFFF824CE1A0ULL), NULL);

	// Say hello and put the kernel base in userland to we can use later
	printfkernel("PS4 Linux Loader for 0.920.030\n");

	printfkernel("kernel base is:0x%016llx\n", 0xFFFFFFFF82200000ULL);

	uint64_t uaddr;
	memcpy(&uaddr, &args[2], 8);

	printfkernel("uaddr is:0x%016llx\n", uaddr);

	copyout(&kernel_base, uaddr, 8);

	return 0;
}

void usbthing()
{

	printf("Open bzImage file from USB\n");
	FILE *fkernel = fopen("/mnt/usb0/bzImage", "r");
	fseek(fkernel, 0L, SEEK_END);
	int kernelsize = ftell(fkernel);
	fseek(fkernel, 0L, SEEK_SET);

	printf("Open initramfs file from USB\n");
	FILE *finitramfs = fopen("/mnt/usb0/initramfs.cpio.gz", "r");
	fseek(finitramfs, 0L, SEEK_END);
	int initramfssize = ftell(finitramfs);
	fseek(finitramfs, 0L, SEEK_SET);

	printf("kernelsize = %d\n", kernelsize);
	printf("initramfssize = %d\n", initramfssize);

	printf("Checks if the files are here\n");
	if (kernelsize == 0 || initramfssize == 0) {
		printf("no file error im dead");
		fclose(fkernel);
		fclose(finitramfs);
		return;
	}

	void *kernel, *initramfs;
	char *cmd_line = "panic=0 clocksource=tsc radeon.dpm=0 console=tty0 console=ttyS0,115200n8 "
		"console=uart8250,mmio32,0xd0340000 video=HDMI-A-1:1920x1080-24@60 "
		"consoleblank=0 net.ifnames=0 drm.debug=0";

	kernel = malloc(kernelsize);
	initramfs = malloc(initramfssize);

	printf("kernel = %llp\n", kernel);
	printf("initramfs = %llp\n", initramfs);

	fread(kernel, kernelsize, 1, fkernel);
	fread(initramfs, initramfssize, 1, finitramfs);

	fclose(fkernel);
	fclose(finitramfs);

	//Call sys_kexec (153 syscall)
	syscall(153, kernel, kernelsize, initramfs, initramfssize, cmd_line);

	free(kernel);
	free(initramfs);

	//Reboot PS4
	int evf = syscall(540, "SceSysCoreReboot");
	syscall(546, evf, 0x4000, 0);
	syscall(541, evf);
	syscall(37, 1, 30);

}

