SceInt32 main(int argc, const char *const argv[])
{
	struct thread *td;

	printf("Connected!\n");

	uint64_t* dump = mmap(NULL, 0x1000, PROT_READ | PROT_WRITE, MAP_ANONYMOUS | MAP_PRIVATE, -1, 0);

	printf("Starting kernel patch...\n");

	int sRet = syscall(11, kpayload, td, dump);

	printf("Kernel patched, Kexec initialized!\n");

	printf("Starting PS4 Linux Loader\n");

	usbthing();

	printf("Done!\n");

	return 0;
}